const ProductRightViews = (props) => {
    const data = props.products;

    const fassured =
        'https://static-assets-web.flixcart.com/www/linchpin/fk-cp-zion/img/fa_62673a.png';

    return (
        <>
            <div>
                <p>{data.title.longTitle}</p>
                <p
                    style={{
                        marginTop: '-15px',
                        color: '#878787',
                        fontSize: '14px',
                    }}
                >
                    8 Rating & 1 Reviews
                    <span>
                        <img
                            src={fassured}
                            style={{ width: '77px', marginLeft: '20px' }}
                            alt=""
                        />
                    </span>
                    <div>
                        <span>{data.price.cost}</span>
                        <span>{data.price.mrp}</span>
                        <span></span>
                    </div>
                </p>
            </div>
        </>
    );
};

export default ProductRightViews;
